import React from "react";
import ReactDOM from "react-dom";
import "./index.css";

let currTime=new Date(2023,7,5,20);
currTime=currTime.getHours();

var greet=["Morning","Afternoon","Night"]

const cssStyle={}

if(currTime>=1 && currTime<12){
  greet=greet[0]
  cssStyle.color="green"
}else if(currTime>=12 && currTime<19){
  greet=greet[1]
  cssStyle.color="orange"
}else if(currTime>=19){
  greet=greet[2]
  cssStyle.color="green"
}

ReactDOM.render(
  <>
    <h1>Hello Ambi,<span style={cssStyle}>Good {greet}</span> </h1>
  </>,
  document.getElementById("root")
);
